import React, { Component } from 'react';
import Footer from '../components/Footer';
import Header from '../components/Header';
import Projects from '../components/Projects';

class Portfolio extends Component {
  render() {
    const projects = [
      { name: 'MongoDB', describe: 'Querys para buscar dados em um banco de dados NoSQL - MongoDb', link: '/mongodb' },
      { name: 'TFC', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
      { name: 'TFC', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
    ];
    return (
    <>
      <Header />
      <Projects projects={ projects }/>
      <Footer />
    </>
  )
  }
}

export default Portfolio;
